\ln a_k)}}$$$$=\\frac{1}{n}\\sum_{k=1}^{n}{\\ln a_k}=\\frac{1}{n}(\\ln a_1+\\ln a_2\\ln a_3+...+\\ln a_n)$$$$=\\frac{1}{n}{\\ln{(a_1a_2...a_n)}}=\\ln{(a_1a_2...a_n)}^{\\frac{1}{n}}$$故原极限y=$\\ln{(a_1a_2...a_n)}^{\\frac{1}{n}}$||$\\lim_{x\\to0}{({\\frac{a_1^x+a_2^x+a_3^x+...+a_n^x}{n}})}^{\\frac{1}{x}}$$$$=\\lim_{x\\to0}{(1+{\\frac{a_1^x+a_2^x+a_3^x+...+a_n^x-n}{n}})}^{\\frac{1}{x}}$$$$=\\lim_{x\\to0}{\\{[1+\\frac{\\sum_{k=1}^{n}{(a_k^x-1)}}{n}]^{\\frac{n}{\\sum_{k=1}^{n}{(a_k^x-1)}}}\\}^{\\frac{\\sum_{k=1}^{n}{(a_k^x-1)}}{x}\\cdot\\frac{1}{n}}}$$=$$e^{\\lim_{x\\to0}{\\frac{\\sum_{k=1}^{n}{(a_k^x-1)}}{x}\\cdot\\frac{1}{n}}}$$$$而\\frac{\\sum_{k=1}^{n}{(a_k^x-1)}}{x}=\\lim_{x\\to 0}{\\sum_{k=1}^{n}{a_k^x\\ln a_k}}=\\ln{(a_1a_2a_2...a_n)}$$所以原式$$=e{\\frac{1}{n}\\ln(a_1a_2...a_n)}=(a_1a_2...a_n)^{\\frac{1}{n}}$$','2021-09-23 14:03:03',2,37,3),(31,'$meiyoufenxi$',0,'$abc$','2021-09-25 07:39:36',0,2,1),(32,'$线性代数好好学啊$',0,'$abc\\begin{cases}a=1\\\\\nb=2\\\\\nc=3\\end{cases}$','2021-09-25 07:39:38',0,6,1),(33,'$啊实打$',0,'$abc\\in\\notin\\varnothing$','2021-09-25 07:39:39',0,6,1),(34,'$啊实打$',0,'$abc$','2021-09-25 07:39:40',0,6,1),(35,'$analysis$',0,'$abc\\lim _{x\\rightarrow \\dfrac{\\pi }{2}}\\left( \\sin x\\right) ^{\\tan x}$','2021-09-25 07:39:40',1,6,1),(36,'$简单的积分$',0,'$abc\\begin{aligned}=\\left[ \\arctan x\\right] _{-\\infty }^{+\\infty }\\\\\n=\\lim _{x\\rightarrow +\\infty }\\arctan x-\\\\\n\\lim _{x\\rightarrow -\\infty }\\arctan x\\end{aligned}$','2021-09-25 07:39:41',0,43,1),(37,'$阿萨大大$',0,'$abc\\begin{aligned}=\\arctan x-\\\\\n\\arctan y\\end{aligned}$','2021-09-25 07:39:42',0,43,1),(39,'$asdasdasd$',0,'${原题=}$','2021-09-25 10:08:28',0,45,1),(40,'$asdasd$',0,'${原题=}$','2021-09-25 12:31:31',0,7,1);
