INSERT INTO `knowledge_point` VALUES (1,'映射和函数的异同点，指的是映射与函数的相同与不同之处。函数与映射都是两个非空集合中元素的对应关系，集合中的元都有方向。但是函数要求两个元素必须是数，而映射中两个集合的元素是任意的数学对象。<h1>相同点：</h1><br/>(1)函数与映射都是两个非空集合中元素的对应关系；<br/>(2)函数与映射的对应都具有方向性；<br/>(3) A 中元素具有任意性， B 中元素具有唯一性，即 A 中任意元素 B 中都有唯一元素与之对应。（多值函数除外，这类函数一般不纳入函数的范畴）<br/><h1>区别：</h1><br/>(1)函数是一种特殊的映射，它要求两个集合中的元素必须是数，而映射中两个集合的元素是任意的数学对象。<br/>(2)函数要求每个值域都有相应的定义域与其对应，也就是说，值域这个集合不能有剩余元素，而构成映射的像的集合是可以有剩余。（注意：映射的像的集合与映射的值域是不一定相等的，映射的值域是映射的像的集合的子集）<br/> (3)对于函数来说有先后关系，即定义域根据对应法则产生的值域，而对于映射来说没有先后关系，两个集合同时存在，所以函数值域中的每个数都有定义域中的数和它对应，而映射像中的元素则不一定有原像中的元素与他对应。','极限与无穷',1),(2,NULL,'函数的连续性与间断点',1),(3,'asdasdasdasdasdasdasd','映射与函数',1),(4,NULL,'隐函数',2),(5,NULL,'函数的微分',2),(6,NULL,'导数的概念及求导法则',2),(7,NULL,'高阶导数',2),(8,NULL,'不定积分的概念与性质',3),(9,NULL,'换元积分法',3),(10,NULL,'分部积分法',3),(11,NULL,'有理函数的积分',3),(12,NULL,'齐次方程',4),(13,NULL,'常系数齐次线性微分方程',4),(14,NULL,'可分离变量的微分方程',4),(15,NULL,'一阶线性与高阶线性微分方程',4),(16,NULL,'常系数非齐次线性微分方程',4),(17,NULL,'坐标的曲线积分',5),(18,NULL,'面积的曲面积分',5),(19,NULL,'高斯公式与斯托克斯公式',5),(20,NULL,'弧长的曲线积分',5),(21,NULL,'格林公式',5),(22,NULL,'坐标的曲面积分',5),(23,NULL,'概念和性质',6),(24,NULL,'二重积分',6),(25,NULL,'重积分的应用',6),(26,NULL,'三重积分',6),(27,NULL,'微积分的基本公式',7),(28,NULL,'反常积分',7),(29,NULL,'概念与性质',7),(30,NULL,'换元法与分部积分法',7),(31,NULL,'物理学上的应用',8),(32,NULL,'元素法',8),(33,NULL,'几何学上的应用',8),(34,NULL,'幂级数',9),(35,NULL,'傅里叶级数',9),(36,NULL,'常数项级数',9),(37,NULL,'多元函数的极值',10),(38,NULL,'方向导数与梯度',10),(39,NULL,'全微分',10),(40,NULL,'偏导数',10),(41,NULL,'隐函数的求导法则',10),(42,NULL,'多元复合函数',10),(43,NULL,'函数的极值与最值',11),(44,NULL,'微分中值定理',11),(45,NULL,'洛必达法则',11),(46,NULL,'泰勒公式',11),(47,NULL,'函数的单调性与凹凸性',11),(48,NULL,'平面与空间直线',12),(49,NULL,'数量积与混合积',12),(50,NULL,'向量及线性运算',12),(51,NULL,'曲面与空间曲线',12);
